export const inventoryNFTIdsState = writable<string[]>([]);

// token map store is written to by AlchemyTokenStore
// NOTE: ETH doesn't have an address, so its indexed with "ETH" instead of address!!
export const tokenMapStore = new MapStore<string, Token>();

export const tokenInventoryStore = derived(
    [tokenMapStore, activeTradeStore, alchemyTokensStore],
    ([$tokenMapStore, $activeTradeStore], set) => {
        if ($activeTradeStore === null) {
            // if theres no active trade items then tokenMapStore === display
            const tokenMapValues = Array.from(tokenMapStore.values());
            set(tokenMapValues);
        } else {
            const tokenMapStoreSnapshot = new Map<string, Token>(tokenMapStore as Map<string, Token>);

            // do a subtraction of trade offer from the original map store
            // to create the updated (virtual) token inventory store
            const tradeItems = $activeTradeStore.myTradeOffer;

            tradeItems.map((tradeItem) => {
                // Run through trade items, and handle token diffs
                if (tradeItem.type) {
                    if (tradeItem.type === "ETH") {
                        const tokenTradeItem = tradeItem;
                        const walletBalance = tokenMapStoreSnapshot.get("ETH") as Token;

                        if (walletBalance.balance && tokenTradeItem.balance) {
                            const netBalance = walletBalance.balance.sub(tokenTradeItem.balance);
                            const updateValue = {
                                ...walletBalance,
                                balance: netBalance,
                            } as Token;

                            tokenMapStoreSnapshot.set("ETH", updateValue);
                        }
                    } else if (tradeItem.type === "ERC20") {
                        const tokenTradeItem = tradeItem;
                        const walletBalance = tokenMapStoreSnapshot.get(tokenTradeItem.address) as Token;

                        if (walletBalance.balance && tokenTradeItem.balance) {
                            const netBalance = walletBalance.balance.sub(tokenTradeItem.balance);

                            const updateValue = {
                                ...walletBalance,
                                balance: netBalance,
                            } as Token;

                            tokenMapStoreSnapshot.set(tokenTradeItem.address, updateValue);
                        }
                    }
                }
            });
            set(Array.from(tokenMapStoreSnapshot.values()));
        }
    },
    [] as Token[]
);

